  useEffect(() => {
    fetch('/api/historys').then(res => res.json).then(history =>{

      setHistory({history: history}); 

    }); 
  }, []);



  return(
    <div className ="app">
      <Header/>
      <Game/>

    </div>
  )

}




export default App;
